    "title": "PM Modi Exclusive: 'Don't Have Cordial Relations, But I Call Them When...': NaMo On Ties With Gandhis",
    "link": "https://news.abplive.com/elections/pm-modi-exclusive-interview-dont-have-cordial-relations-but-i-call-them-namo-on-ties-with-gandhis-1690958",
    "keywords": ["election 2024"],
    "creator": ["ABP News Bureau"],
    "video_url": null,
    "description":
      "In the run up to the seventh and final phase of the 2024 Lok Sabha elections, Prime Minister Narendra Modi spoke with ABP Network in an exclusive interview. Speaking with Suman De of ABP Ananda and Rohit Sawal and Romana Isar Khan of ABP News, PM Modi revealed how his personal relations with the other political parties are like. He also recounted how he personally called his political rival Rahul Gandhi when his helicopter faced issues and even sent help for Sonia Gandhi.Know Why PM Modi Spoke With Rahul Gandhi PersonallyPM Modi told ABP News during the exclusive interview, how he does not have cordial relations with the Gandhi family but stands with them in times of trouble.Recalling an incident from the 2019 Lok Sabha elections, PM Modi said: \"I have good relationship with everyone except the royal family. I have no personal relationship with the royal family, but I have always been there for them in times of trouble. During some election, there was an issue with Rahul Gandhi's airplane in Maharashtra, and I immediately called him.\"Once, while Sonia Gandhi was campaigning against me in Kashi, she suddenly fell ill. I immediately arranged for a special plane to bring her to Delhi,\" he added.Watch | नरेंद्र मोदी ने जब राहुल गांधी-सोनिया गांधी को किया था फोन...PM @narendramodi ने सुनाया किस्सा @SavalRohit | @romanaisarkhan | @IamSumanDe#PMModiOnABP #NarendraModi #PMModi #Rahulgandhi #soniagandhi #LokSabhaElection2024 #ModiInterview #News #Hindi #Hindinews… pic.twitter.com/Iksr7Cy9sb— ABP News (@ABPNews) May 28, 2024PM Modi Recalls When Sonia Gandhi's Helicopter Met With An Accident In DamanPM Modi also recounted an incident when Sonia Gandhi's helicopter crashed in Daman, with Ahmed Patel on board.Stating that he was the Chief Minister of Gujarat at that time this incident occured, PM Modi said: \"I spoke to Ahmed Patel and told him that the situation is very serious, and I immediately arranged for an air ambulance. He informed me that they were safe, but the helicopter was significantly damaged. I believe that these are all people working for our country. This is a sense of kinship, and I don't mix politics with it.\"#PMModiOnABP | PM मोदी ने राहुल गांधी को फोन क्यों किया? देखिए पीएम (@narendramodi) ने इंटरव्यू में खुद किया खुलासा @SavalRohit | @romanaisarkhan | @IamSumanDehttps://t.co/smwhXURgtc#PMModi #NarendraModi #LokSabhaElections #Elections2024 #NarendraBhaiOnABP #RahulGandhi… pic.twitter.com/J4qIctcsOE— ABP News (@ABPNews) May 28, 2024ALSO READ: PM Modi Interview: An 'Ekta Mall' In Every State Capital — PM Modi Shares His 'Unity' Concept",
