    "title": "Lok Sabha Elections 2024 Live: Ahead Of Phase 7, PM Modi To Address Poll Rallies In Bengal, Odisha Today",
    "link": "https://news.abplive.com/elections/lok-sabha-elections-2024-live-updates-may-29-pm-modi-akhilesh-yadav-rahul-gandhi-priyanka-sonia-mamata-banerjee-arvind-kejriwal-amit-shah-election-commission-of-india-1690945",
