    "video_url": null,
    "description":
      'Lok Sabha Elections 2024 Live: Hello and welcome to this Live Blog. Please follow this space and keep refreshing the page for all the latest updates and developments on Lok Sabha elections.Rahul Gandhi Says Narendra Modi Will Not Be PM After June 4Rahul Gandhi, the Congress leader, stated on Tuesday that Narendra Modi will not be the next prime minister, calling it a "guarantee". Addressing a rally in Modi\'s parliamentary constituency of Varanasi, Gandhi stated that the contest here was not between a prime ministerial candidate and Congress nominee Ajay Rai because Modi will not return as PM."I am telling you with a guarantee that after June 4, Narendra Modi ji will not be the prime minister of this country," Gandhi stated. "The contest between the two is intense and in this contest, Ajay Rai may win," he stated.The fight is between Varanasi autorickshaw drivers, Banarasi saree weavers, farmers, labourers, and billionaires.Gandhi claimed: Modi has waived billionaires\' loans totalling Rs 16 lakh crore.Karnataka, Telangana & Himachal Results Will Repeat For BJP In Odisha: PatnaikHours after Union Home Minister Amit Shah claimed that Naveen Patnaik would become a former chief minister after the vote count on June 4, the ruling BJD president said on Tuesday that the saffron party will face the same electoral fate as in Karnataka, Telangana, and Himachal Pradesh.Patnaik stated in a video message that the Bhartiya Janata Party promised to form a government in Karnataka but failed to do so. They made the same claim for Telangana and failed. They made the same claim in Himachal Pradesh and failed as well." "I am certain that their same reputation will continue in this elections in Odisha," said Patnaik, Odisha\'s five-time chief minister.Earlier, Shah claimed at three consecutive election rallies that Patnaik would become a former chief minister after the votes were counted on June 4, and the BJP is poised to form the government in Odisha after winning more than 75 of the state\'s 147 seats. Shah also claimed that the saffron party candidates would win 17 of the state\'s 21 Lok Sabha seats.PM Modi To Meditate At Vivekananda\'s Landmark In Tamil Nadu After Poll Campaign Ends On May 30Following the conclusion of the Lok Sabha election campaign on May 30, Prime Minister Narendra Modi will meditate at the Rock Memorial, a monument dedicated to Swami Vivekananda in Kanyakumari, according to BJP leaders on Tuesday.The Tamil Nadu unit of the Congress stated that the Election Commission should not grant permission for the PM\'s programme because the model code of conduct was in effect. TNCC chief K Selvaperunthagai claimed that such a move was an attempt at "indirect campaigning" after the vote canvassing had concluded.The Prime Minister will meditate at Dhyan Mandapam from the evening of May 30 to the evening of June 1 where Vivekananda, a spiritual icon admired by Modi, is said to have had a divine vision about \'Bharat Mata\', according to BJP leaders. Following the 2019 election campaign, the prime minister conducted a similar meditation exercise in a Kedarnath cave.',
